import React from 'react'
import dogs from '../dogsdata'

const DogDetails = (props) => {
    const selectedDogId = props.match.params.writtenDogId;
    const showDogs = dogs.find((dog) => dog.id === selectedDogId)
    return (
        <div>
            <h1>selectedDog: {selectedDogId}</h1>
            <ul>
                {
                    showDogs.map((dog) => {
                        return <li>{dog.description
                        }
                            <li>
                                {dog.id}
                            </li>
                            <li>
                                {dog.breed}
                            </li>
                        </li>
                    })
                }
            </ul>
        </div>
    )
}

export default DogDetails
